import React from "react";
import ".style.css";
interface IImageCardDada {
  link: string;
  firstHeader: string;
  secondHeader: string;
  imageUrl: string;
  className: string;
  headerGap: React.CSSProperties;
  imageSize: React.CSSProperties;
  firstHeaderStyle: React.CSSProperties;
  secondHeaderStyle: React.CSSProperties;
}

export const ImageCard = ({
  link,
  firstHeader,
  secondHeader,
  imageUrl,
  className,
  headerGap,
  imageSize,
  firstHeaderStyle,
  secondHeaderStyle,
}: IImageCardDada) => {
  return (
    <a href={link} className={className}>
      <div className="position-align" style={headerGap}>
        <span style={firstHeaderStyle}>{firstHeader}</span>
        <span style={secondHeaderStyle}>{secondHeader}</span>
      </div>
      <div style={imageSize}>
        <img src={imageUrl} alt="card-image" className="card-image-size" />
      </div>
    </a>
  );
};
